import React from 'react';

function Test() {
    return (
        <div className="container-fluid">
            <div className="row">
                <div className="col-7 h-100 d-inline-block" style={{ backgroundColor: 'rgba(0,0,255,0.1)' }}>
                    Hello
                </div>
                <div className="col-5 h-100 d-inline-block" style={{ width: '120px', backgroundColor: 'rgba(0,0,255,0.1)' }}>Height 100%</div>
                {/* <div className="col-5">
                    hi
                </div> */}
            </div>
        </div>
    );
}

export default Test;
